import React, { Component } from 'react';
import PropTypes from 'prop-types';
import ChatBot from 'react-simple-chatbot';

class Reviewc extends Component {
  constructor(props) {
    super(props);

    this.state = {
      name: 'Ahmed',
      city: 'Alexandria',
      number: '01090761007',
      site: 'Has health',
      slogane: 'where care found',
    };
  }

  componentWillMount() {
    const { steps } = this.props;
    //const { name, city, number, site, slogane } = steps;

    //this.setState({ name, city, number, site, slogane });
    const { name } = steps;
    this.setState({ name });
  }

  render() {
    const  { name, city, number, site, slogane } = this.state;
    return (
      <div style={{ width: '100%' }}>
        <h3>Summary</h3>
        <table>
          <tbody>
            <tr>
              <td>Name</td>
              <td>{name.value}</td>
            </tr>
            <tr>
              <td>City</td>
              <td>{city}</td>
            </tr>
            <tr>
              <td>Number</td>
              <td>{number}</td>
            </tr>
            <tr>
              <td>Site Name</td>
              <td>{site}</td>
            </tr>
            <tr>
              <td>Site Slogane</td>
              <td>{slogane}</td>
            </tr>
          </tbody>
        </table>
      </div>
    );
  }
}

Reviewc.propTypes = {
  steps: PropTypes.object,
};

Reviewc.defaultProps = {
  steps: undefined,
};

class HasChatBot2 extends Component {
    render() {
      return (
        <ChatBot
        steps={[
            {
              id: '1',
              message: 'What number I am thinking?',
              trigger: '2',
            },
            {
              id: '2',
              options: [
                { value: 1, label: 'Designer', trigger: '4' },
                { value: 2, label: 'Front end', trigger: 'fe' },
                { value: 3, label: 'Back end', trigger: '3' },
              ],
            },

            {
              id: 'fe',
              options: [
                { value: 1, label: 'html', trigger: '4' },
                { value: 2, label: 'css', trigger: '4' },
                { value: 3, label: 'js', trigger: '4' },
              ],
            },





            {
              id: '3',
              message: 'Wrong answer, try again.',
              trigger: '2',
            },
            {
              id: '4',
              message: 'Awesome! You are a telepath!',
              end: true,
            },
          ]}
        />
      );
    }
  }
  
export default HasChatBot2;
